import React from 'react';

function Signup() {
    return(
        <div className="row">
            <div className="col-sm-12">
                <h3>Sign up to start your journey!</h3>
                <label>First name:</label>
                <input placeholder="first name" />
            </div>
        </div>
    );
}

export default Signup;
